import { useState } from "react"
import Header from './components/Header'
import Tasks from './components/Tasks'


function App() {
  const [tasks, setTasks] = useState([
    {
        id: 1,
        text: 'Doctors Appoitment',
        day: 'July 5th at 2:30pm',
        reminder: true,
    },
    {
        id: 2,
        text: 'School Meetings',
        day: 'June 17th at 1:30pm',
        reminder: true,
    },
    {
        id: 3,
        text: 'Food Shopping',
        day: 'June 15th at 2:30pm',
        reminder: false,
    },
])
  return (
    <div className="container">
      <Header/>
      <Tasks task={tasks}/>
    </div>
  );
}

export default App;
